import React from 'react'
import { Link } from 'react-router-dom'
import { routes } from '../routes'


//Este componente debera ser estilado como "dark" o "light" dependiendo del theme del Context

const Navbar = () => {

  const {theme, themeDispatch} = useTheme 

  return (
    <nav>
      <Link to={routes.home}><h3>Home</h3></Link>
      <Link to={routes.details}><h3>Detail</h3></Link>
      <Link to={routes.contact}><h3>Contacto</h3></Link>
      <Link to={routes.favs}><h3>Destacados</h3></Link>
      {/* Deberan implementar ademas la logica para cambiar de Theme con el button */}
      <button onClick={{}}>Change theme</button>
    </nav>
  )
}

export default Navbar
